import {all,takeLatest} from 'redux-saga/effects'
import {Action} from "./app/redux";
export default function* () {
    yield all([
        takeLatest(Action.Types.HANDLE_SIDE_MENU, function* (action) {
            console.log("@@ action", action)


        })

    ])

}
